import React from 'react'

export default function Todos(props) {
    return (
        <div className='container'>
            <div class="col-5">
                <div class="card shadow-sm">
                {props.noteTitle}
                    <div class="card-body">
                        <p class="card-text">{props.noteData}</p>
                    </div>
                </div>
            </div>
        </div>
    )
}
